import React from 'react';

interface ConcatLayerProps {
    layers: { name: string }[];
}

const ConcatLayer: React.FC<ConcatLayerProps> = ({ layers }) => {
    return (
        <div className="concat-layer">
            <h3>Concat Layer</h3>
            <p>Layers to concatenate:</p>
            <ul>
                {layers && layers.length > 0 ? (
                    layers.map((layer, index) => (
                        <li key={index}>{layer.name}</li>
                    ))
                ) : (
                    <li>No layers selected</li>
                )}
            </ul>
        </div>
    );
};

export default ConcatLayer;
